query posts($filter: Fireblog_PostFilter, $limit: Int!, $skip: Int) {
          fireblog {
            posts(
              limit: $limit
              skip: $skip
              filter: $filter
              sort: { publishedAt: desc }
            ) {
              teaser
              slug
              title
              content
              publishedAt
              updatedAt
              image(auto: [compress, format]) {
                url
              }
              imagePostList: image(
                w: 400
                h: 220
                fit: crop
                crop: center
                auto: [compress, format]
              ) {
                url
              }
            }
          }
        }
